import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import SpeechToText from './SpeechToText';

const App = () => (
  <Router>
    <Switch>
      <Route path="/transcription/:sessionId" component={SpeechToText} />
      <Route path="/" exact>
        <h1>Welcome to the Speech-to-Text App</h1>
        {/* Add links or instructions for creating a session */}
      </Route>
    </Switch>
  </Router>
);

export default App;
